import React, { Component } from "react";
import MovieItem from "./Movie/MovieItem";

class Dashboard extends Component {
  render() {
    return (
      <div>
        <h1>Welcome to MyMovieList</h1>
        <MovieItem />
      </div>
    );
  }
}
export default Dashboard;
